import { auth } from '../firebase_config';
import Navbar from "./components/Navbar";
import Demande from "./components/Demande";
import React, { Component } from 'react';

console.log(auth.currentUser)

class Accueilconnexion extends Component {
    render() {
        return (
            <div>
                <Navbar user={ this.props.user} username={ this.props.username } userchange={ this.props.userchange } userpic={ this.props.userpic } />
                <div class="container-fluid main">
	                <div class="row">
                        <div class="col-lg-2 p-2 d-none d-lg-block">

                        </div>
                        <div class="col-lg-7 p-2 ps-mobile">

                        </div>
                        <div class="col-lg-3 p-2 d-none d-lg-block">
                            <div class="w-100">
                                <Demande />
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Accueilconnexion;
